import "./App.css";
import { useState } from "react";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar/Navbar";
import Container from "./components/Container/Container";
import RightNavbar from "./components/RightNavbar/RightNavbar";
import Dashboard from "./components/Dashboard/Dashboard";
import Usermanage from "./components/Usermanage/Usermanage";
import Inquirymanage from "./components/Inquirymanage/Inquirymanage";
import Jobpaymentmanage from "./components/Jobpaymentmanage/Jobpaymentmanage";
// import Team from "./components/";

import NavContext from "./Context/NavContext";
function App() {
  const [nav, setNav] = useState(false);
  const value = { nav, setNav };

  return (
    <div className="App">
      <NavContext.Provider value={value}>
        <Navbar />
        <Container
          stickyNav={<RightNavbar />}
          content={
            <Routes>
              <Route path="*" element={<main>NOT FOUND</main>} />
              <Route path="/" element={<Dashboard />} />
              <Route path="/usermanage" element={<Usermanage />} />
              <Route path="/inquirymanage" element={<Inquirymanage />} />
              <Route path="/jobpaymentmanage" element={<Jobpaymentmanage />} />
              <Route path="/messages" element={<main>Messages</main>} />
            </Routes>
          }
        />
      </NavContext.Provider>
    </div>
  );
}

export default App;
